import { NavLink } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Products Page</h1>
      <ul>
      <li><NavLink to='/products/details'>A Book</NavLink></li>
      <li><NavLink to='/products/details'>A carpet</NavLink></li>
      <li><NavLink to='/products/details'>A Cricket Bat</NavLink></li>
      </ul>
    </section>
  );
};

export default Products;
